import React from 'react'
import Logo from '../img/CRILOGO.png'


function Head() {
    const Img = {
        width :"100px",
        height:"100px"

    }
    return (
        <div className="container">
            <img src={Logo} alt="logo" id="logo"  style={Img}/>
            <h2>C.R.I FLUID SYSTEM</h2>
        </div>
    )
}

export default Head
